import Footer from '../components/layout/Footer';
import Header from '../components/layout/Header';
import MainCarpeta from '../components/MainCarpeta';

const Carpeta = (props) => {
  return (
    <>
      <Header />
      {<MainCarpeta />}
      <Footer />
    </>
  );
}

export default Carpeta;
